import { useLocation } from "react-router-dom";
import BotaoPrecisao from "../compontente/BotaoPrecisao/BotaoPrecisao";
import Cabecalho from "../compontente/Cabecalho/Cabecalho";
import Estante from "../compontente/Estante/Estante";
import "./TelaEstante.css";
import { useEffect, useState } from "react";
import axios from "axios";


function TelaEstante() {
  const [Estantes, setEstantes] = useState([{}]);
  const location = useLocation();
  useEffect(() => {
    axios
      .get("http://localhost:8080/map")
      .then((resposta) => {
        setEstantes(resposta.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);
  
  return (
    <>
      <Cabecalho />
      <div className="TelaEstante">
        {Estantes.map((conteudo, i) => {
        
      
          if(conteudo.books !== 0){
            for( var livro in conteudo.books){
              if(livro.id == location.state.id){
                <Estante
            x={conteudo.x}
            y={conteudo.y}
            r={conteudo.rotate}
            h={conteudo.height}
            w={conteudo.width}
            c="red"
          />
              }else{
                <Estante
            x={conteudo.x}
            y={conteudo.y}
            r={conteudo.rotate}
            h={conteudo.height}
            w={conteudo.width}
            c="red"
          />
              }
            }
          }else{
        return(
          <Estante
            x={conteudo.x}
            y={conteudo.y}
            r={conteudo.rotate}
            h={conteudo.height}
            w={conteudo.width}
            c="red"
          />
        )}
        })}
        <BotaoPrecisao />
      </div>
    </>
  );
}

export default TelaEstante;
